import React from 'react';


import { useSelector, useDispatch } from 'react-redux'
import { adduser2} from '../Componants/AddUser'

function Santosh() {
    const jadhavtext = useSelector((state) => state.counter.value);
    const dispatch = useDispatch()
    return (
      <div>
             Santosh = {jadhavtext.name} , {jadhavtext.email}
             <button onClick={() => dispatch(adduser())} > Submitrrrrr </button>
             <button onClick={() => dispatch(adduser({
                name:"pri",
                email:"pp@rr.com"

             }))} > Submitrrrrr </button>
      </div>
    );
  }

  export default Santosh;
